Я К ЭТОМУ ПРИЛОЖЕНИЮ, ПИШИТЕ НЕ ОТ СВОЕГО ЛИЦА ЧТО ХОТИТЕ. Вам понадобится: один телефон, немного фантазии(или реальная история, о которой нельзя молчать) и две минуты чтобы написать пост. А ещё пластиковая трубка, гранулированный порох, синяя изол... Чел, я хз как делают другие, но я пишу анонимные посты в сигме про типо смешные истории и сплетни. Я ирл и я в сигме это максимально два разных человека. Все текста выдуманные больными головами авторов. Совпадения случайны. Не призываем ни к чему.','','ПП','2025-04-03 17:36:08',0,0,1),(12,'Лалала','','ПП,мама очира,паста про говно','2025-04-03 17:57:57',0,2,1),(13,'Какака','','максимум,максим,василиса,георгий','2025-04-03 18:00:04',0,1,1),(15,'Еду бухать в баню, нужны бал, кидайте фото в комменты','/uploads/1743700530-872401090-video-1743700526794-0.mp4',NULL,'2025-04-03 20:15:30',0,1,3),(16,'В ВАШЕМ ТЕЛЕФОНЕ📱📲📲📲ЖУКИ ‼️🪲‼️🪲🪲🚫СРОЧНО‼️УДАЛИТЕ🚫📲📲ВАЦАП🚫','',NULL,'2025-04-03 20:17:59',0,3,4),(17,'Я артем дрочи, на коляна пока он спит','/uploads/1743700753-817531856-video-1743700746167-0.mp4',NULL,'2025-04-03 20:19:13',0,3,3),(18,'бля пиздец ребятки ','','емае','2025-04-03 20:28:47',0,5,6),(19,'Tramballonni','',NULL,'2025-04-03 20:28:58',0,4,5),(22,'ребята вы такие молодцы ','','бляхамуха','2025-04-03 20:34:11',0,0,6),(23,'я поняла','',NULL,'2025-04-03 20:35:00',0,0,6),(25,'<3','/uploads/1743701741-30907194-image-1743701740058-0.jpeg',NULL,'2025-04-03 20:35:41',0,0,5),(31,'🙋🏻‍♂️','/uploads/1743701757-379727210-image-1743701743174-0.jpeg',NULL,'2025-04-03 20:35:57',0,0,8),(32,'Ваня скинул хуй','/uploads/1743701799-296244252-image-1743701797207-0.jpeg',NULL,'2025-04-03 20:36:39',0,0,9),(33,'пупупуп','','мы крутые','2025-04-03 20:46:48',0,0,6),(34,'G','',NULL,'2025-04-03 20:46:52',0,0,5),(35,'залупа','','работ','2025-04-03 20:47:01',0,0,8),(36,'Лучшие❤️❤️❤️','',NULL,'2025-04-03 21:03:24',0,0,5),(39,'мы','/uploads/1743703633-724339546-image-1743703630008-0.jpeg','кристинанастя','2025-04-03 21:07:13',0,12,8),(40,'емае','','кристи