 не пошел на пары','',NULL,'2025-04-07 10:12:47',0,6,37),(220,'красава','',NULL,'2025-04-07 10:39:30',0,2,2),(221,'покупайте аватарки за 50 рублей','',NULL,'2025-04-07 10:43:18',0,3,2),(222,'мистер гундос','/uploads/image-1744020891714-0.jpeg',NULL,'2025-04-07 13:14:52',0,8,2),(223,'я даун','',NULL,'2025-04-07 13:22:07',0,2,2),(224,'Самый лучший мальчик','/uploads/image-1744021451651-0.jpeg','Очир','2025-04-07 13:24:13',0,5,2),(225,'чдкд','',NULL,'2025-04-07 13:49:42',0,1,2),(226,'щащащащащащщащащащащащщащаща','',NULL,'2025-04-07 13:54:39',0,1,2),(231,'Пиздец как скучно…','/uploads/image-1744027992362-0.jpeg',NULL,'2025-04-07 15:13:19',0,3,2),(232,'йоу','/uploads/image-1744028283604-0.jpeg',NULL,'2025-04-07 15:18:05',0,6,8),(233,'Попытки SQL-ильекций','/uploads/image-1744029586568-0.png','???','2025-04-07 15:39:47',0,5,2),(234,'ФИТ ФИЯ','',NULL,'2025-04-07 16:39:59',0,3,2),(235,'Вот что мне нравится в США - это культура сосания пива. В России в последние годы я чувствовал себя неуютно: везде этот ебаный зож. Какие-то пидорасы все время ебут тебе мозг, что они больше не пьют и стали счастливыми! Какие-то хуесосы наркологи орут с ютуба, что пора бросать или сопьешься. Короче, типа если ты алкаш, то ты скуф, тебя лечить надо. На пивных элементалей, типа меня, все всегда смотрели с неуважением, а бабы с презрением. А тут все наоборот. Пить пиво по к/д не возбраняется вообще. В некоторых штатах я мужиков без банки в руках и не видел. И все выглядят как скуфы и все насрать на это. В холодильнике всегда должно быть несколько сикс паков, 5-6 банок в день - это норма, по сути пиво заменяет тут воду. И никакого осуждения. Класс.','/uploads/image-1744034884034-0.jpeg',NULL,'2025-04-07 17:08:09',0,0,2),(236,'Наконец выходит новая часть асассинс крид, называться будет шадоус. Не могу дождаться выхода, хотя остались буквально сутки (советую купить ранний доступ и приступить к игре раньшьше нищих крестьян). Для меня это главный релиз года! И вот почему: нас ждет невероятное приключение с элементами стелса, наполненное при этом стремительным экшеном. Боевка выглядит впечатляюще. В игре будет сразу два героя. Смертоносная баба и вероломный черный самурай. Ожидается сюжет. Хайп невероятный, давно не испытывал такой тряски перед выходом игры. Пиздятина.','/uploads/image-1744034937643-0.jpeg',NULL,'2025-04-07 17:09:00',0,1,2),(237,'Знаете, что я хочу сказать? Темнокожие женщины отличные. Как и латиноамериканки. А вот азиатки мне теперь кажутся душными и расчетливыми. Они сначала подмазываются, а потом очень интересуются вашими деньгами, в том время как Джошанда будет вам варить борщи и дарить любовь. Русские же бабы вам вообще нихуя не дадут. Думайте.','/uploads/image-1744035004081-0.jpeg',NULL,'2025-04-07 17:10:07',0,1,2),(238,'Стенография одного чувака: \nАлиэкспресс? А чё про него рассказывать? Заходишь в маечки, смотришь отзывы баб, да дрочишь. Колготки глядишь с бабами, тоже ничего бывает. Бывают жирухи, бывают нормальные. Я на алиэкспрессе смотрю отзывы баб. Как-то наткнулся на отзывы об хуях резиновых, типа \"да, я сегодня с ним ебалась, он такой мягкий\", а я сразу подумал: \"АЪАВЭАДЖАЭДЖВЫА ВОТ БЫ БЫЛ Я ТАМ ВМЕСТО РЕЗИНОВОГО ХУЯ ТЫ БЫ ВСЁ ПОНЯЛА\"','/uploads/image-1744035066096-0.jpeg',NULL,'2025-04-07 17:11:09',0,2,2),(239,'Прикиньте, как жили кони. Вот когда не было машин и надо было кому-то ехать из Петербурга в Москву. Ездили на конях. И я думаю, что они пиздец как охуевали. Типа это уже не весёлый образ конного спорта, в котором девочка на коне хуярит по трассе. \nИ вот на тебя садится пидор какой-то и хуярит шпорами тебя. Причём, так прикольно, что в конной культуре есть шпоры, а конь воспринимается, как друг, несмотря на это. \nТипа коня хуярят шпорами, чтобы он быстрее бежал. Это как если бы у вас был электроошейник на физре и физрук бы вас подстёгивал разрядами тока. \nА мужик такой встаёт с коня, и говорит ему: \"Ну, мой конь вороной, мы с тобой ещё пройдём сто дорог...\", а конь бы подумал: \"да нахуй мне это надо? Я хочу пастись, траву есть, кобылиц ебать. Я не хочу шпорами в рёбра получать, сука\"','/uploads/video-1744035167342-0.quicktime',NULL,'2025-04-07 17:13:25',0,1,2),(240,'Прикиньте, как жили кони. Вот когда не было машин и надо было кому-то ехать из Петербурга в Москву. Ездили на конях. И я думаю, что они пиздец как охуевали. Типа это уже не весёлый образ конного спорта, в котором девочка на коне хуярит по трассе. \nИ вот на тебя садится пидор какой-то и хуярит шпорами тебя. Причём, так прикольно, что в конной культуре есть шпоры, а конь воспринимается, как друг, несмотря на это. \nТипа коня хуярят шпорами, чтобы он быстрее бежал. Это как если бы у вас был электроошейник на физре и физрук бы вас подстёгивал разрядами тока. \nА мужик такой встаёт с коня, и говорит ему: \"Ну, мой конь вороной, мы с тобой ещё пройдём сто дорог...\", а конь бы подумал: \"да нахуй мне это надо? Я хочу пастись, траву есть, кобылиц ебать. Я не хочу шпорами в рёбра получать, сука\"','/uploads/video-1744035180795-0.quicktime',NULL,'2025-04-07 17:13:32',0,4,2),(241,'Я стал пивным алкашом. Не могу и дня без пива прожить. Так хорошо вечером вьебать холодного пива баночки четыре, а то и шесть. Сразу заебись становится. Мне даже уже похуй что я оскуфел, все просцал и так далее. Просто охуенно сосать пиво. Это лучше чем и с бабами ебаться или в каком-нибудь зале качаться. Какая на хуй разница кто ты, с кем ты, сколько зарабатываешь и как выглядишь, когда накачался пивом и сидишь, балдеешь.','/uploads/image-1744035580300-0.jpeg,/uploads/image-1744035580301-1.jpeg,/uploads/image-1744035580297-2.jpeg,/uploads/image-1744035580299-3.jpeg,/uploads/image-1744035580298-4.jpeg,/uploads/image-1744035580297-5.jpeg,/uploads/image-1744035580299-6.jpeg,/uploads/image-1744035580303-7.jpeg',NULL,'2025-04-07 17:19:44',0,3,2),(242,'Чуваки, у вас картинки во вложениях не листаются дальше третьей, по крайней мере у меня с предыдущим постом так, прикреплял я 8 разных там.','',NULL,'2025-04-07 17:22:54',0,2,2),(243,'Под предыдущим постом комментарий на 100 лайков.','',NULL,'2025-04-07 17:37:42',0,0,2),(244,'Фапреактор_раздел_\"смешное_порно\".','/uploads/image-1744036721997-0.jpeg,/uploads/image-1744036721998-1.jpeg',NULL,'2025-04-07 17:38:45',0,0,2),(245,'Ползунок справа не работает корректно.','/uploads/image-1744036882195-0.png',NULL,'2025-04-07 17:41:25',0,1,2),(246,'Полная и безнадёжная хуета. Завтра ожидаю от тебя до 23.00 по МСК сигну (с еблом и твоим паспортом) поверх аттеста об окончании тобой среднего образования или я выпиздну тебя отсюда по причине недостижения тобой 18 лет.','','долбаёбы','2025-04-07 17:48:51',0,1,4),(247,'Кстати, вы в курсе, что можно на телефоне добавить приложение на главный экран и оно типа уак приожение будет???','',NULL,'2025-04-07 17:50:08',0,3,2),(248,'Рил только что нажал поделиться => добавить на главный экран И У МЕНЯ ОНО ЗАПУСКАЕТСЯ КАК ПРИЛОЖЕНИЕ. PWA работает!!','','разъеб','2025-04-07 18:15:39',0,1,1),(249,'самопост залог успеха (предыдущий пост)👇👇👇\n\nкста, произошёл джава скрипт','/uploads/image-1744039665263-0.jpeg',NULL,'2025-04-07 18:27:46',0,1,4),(250,'пиздец, картинка обрезалась, что за говно','',NULL,'2025-04-07 18:29:28',0,1,4),(251,'','/uploads/image-1744040490039-0.png',NULL,'2025-04-07 18:41:32',0,1,2),(252,'А я видел вашу маму сегодня','','Сиськи,Зебись','2025-04-07 20:28:42',0,5,1),(253,'Подписки отключены в связи с техническими работами','','Staff','2025-04-07 21:27:44',0,0,2),(254,'Это я, кидавший 8 артов в одном посте ниже.\n\nВообще, в какой-то момент увлёкся просмотром артов подобного содержания, типа хоррибле дарк фентези и тд, хотел даже на обои поставить на ноуте что-нибудь, что-то недолго простояло, но оно слишком бросалось в глаза, вернул что-то приятное и нейтральное.\nЕщё я как-то несколько раз в днд играл, друг водил, вот он умел навести вот такой тягучей давящей жути, атмосферу создать как раз для дарк фентези подходящую, очень прикольно было.\n\nДа и антагонисты самые идейно интересные, которые мне понравились, как я заметил, тоже движимы одним лишь желанием человеческих страданий. Как много в этих двух словах. Пикрил 1 в том посте с артами это прям оно, прям сок.\n\n\nСейчас же я как-то остыл, уже, наверное, почти год думаю о том, что я не хочу умирать в итоге, лежать в земле через лет 60 это худшее. Сначала думал завещать своё тело науке, чтоб хоть как-то это отсрочить, стоя крутым скелетом где-нибудь или ещё что, не шарю за эту тему достаточно. Успокаивало. Недолго. Всё-таки я не хочу переставать существовать именно как субъект восприятия. То есть я не хочу лишиться возможности ДУМать/видеть/слушать и тд, общаться с людьми, к тому же я не люблю спать примерно из-за этого же, это банально скучно и ничего не поделать в это время. Возможно, у меня FOMO (Feeling Of Missing Out, погуглите, если что).\nТак вот, к чему я пришёл на данный момент. Сейчас я думаю, что даже быть мозгом в банке, но живым, лучше смерти и небытья. Прикинул так поверхностно вообще способ избежать смерти мозга или обойти это, спросил у гпт, чтоб не искать шизотеории по интернету самостоятельно, и, конечно же, фантастический перенос сознания и прочая хрень вряд ли идёт, потому что это энивей копия, а оригинальный ты остаёшься в своём теле и умираешь в конце концов. Я не биолог, но если мельчайшая деталь мозга это нейрон, то, если постепенно заменить их все на искусственные, то, в теории, можно получить мозг, который не умрёт от старости, при этом сохранив свои когнитивные способности и способности делать фоновую работу, которую мы напрямую не контролируем. Да, возникает вопрос \"остаёшься ли ты при этом \"человеком\"?\", откуда сразу же \"а что вообще делает нас людьми?\", но это уже точно детали реализации, а не зависимость от абстракции.','','Длиннотекст.','2025-04-07 23:46:45',0,4,2),(255,'Забыв обо всем, я закричал во всю глотку, проклиная небеса за то, что отняли у меня Алису. По моему испачканному говном лицу текут слезы отчаяния. Я рву на себе волосы, бью кулаками землю, но ничто из этого не может заглушить моё горе. Я посмотрел на мёртвую Алису. Несмотря на то, что её рыжие волосы стали наполовину коричневыми и большая часть лица была измазана анальной пастой, последней эмоцией, отразившейся на лице была безмятежность. Я ласково поцеловал её в коричневые губы, предварительно убрав изо рта самые большие кусочки кала, и прижал её голову к своей груди. Как мне теперь быть? Любовь всей моей жизни мертва, и я невольно стал её убийцей. Древние мудрецы оказались правы - благими намерениями устлана дорога в ад. Глядя на безмятежное лицо возлюбленной, я спрашиваю себя: \"Что сделать с её телом?\". Я смотрю на труп Алисы. Даже в смерти она была прекрасна. Следы крови, мочи и кала неспособны уменьшить привлекательность её гладко выбритой киски. Совесть, при желании, штука податливая, поэтому она молчит, когда в мою голову приходит эта идея. Я решил, как мне лучше всего почтить её память и ЧТО следует сделать с телом… \nАлиса была ещё теплая, когда я в неё вошёл. К моему удовольствию, она оказалась девственницей. Я был счастлив узнать, что именно я тот счастливчик, что сорвет эту розу,пусть даже от неё пахнет совсем не розами. Без всякой жалости я разрыва последнюю преграду на пути нашей любви, и трава под нами окрашивается в смесь красного, коричневого, жёлтого и зелёного. Я задираю футболку и срываю лифчик. Ваня ошибался, сиськи я все-таки нашёл. Я впиваюсь зубами в нежную плоть, невольно размызывая говно с моего лица по единственному оставшемуся чистым месту на теле Алисы. Я глажу её мягкие рыжие волосы. Если принюхаться, помимо аромата фекалий можно обнаружить слабый запах шампуня, которым она мыла голову. Постигая все грани мёртвого тела моей любимой, я постепенно ускоряю темп. Разгоняясь все быстрее и быстрее, я смотрю на её бледное лицо, выражение которого не изменяется, как бы сильно и нежно я не ласкал её. Мои глаза снова наполняют слезы, и вместо стонов удовольствия из моей глотки вырывается какое-то ослиное мычание. \n-ИИААА, ИИИАААА!!! - теперь я трахаю  её как пёс, жёстко и грубо, приближаясь к кульминации - ЙИОООООО, ИОЙЙЙЙОООООООО!!!!\nЯ почти готов, уже скоро… Что это? На секунду мне кажется, что губы Алисы немного дернулись. Чтобы снять наваждение, в последние минуты нашей любви я прильнул к ним в страсном поцелуе. Быстрее!!! Быстрее!!! Быстрее!!! Не прекращая поцелуя, я открываю глаза. Быстрее!!! Я хочу видеть её лицо, когда кончу. Быстрее!!! Я чувствую, что ещё несколько секунд, и мой \"Толстяк\" обрушится на её Хиросиму... Быстрее!!! Быстрее!!! БЫСТРЕЕ!!!!!!!! Я кончаю... Алиса открывает глаза... Стоп, ЧТО?!! Блять...\nСказать честно, я очень плохо помню, что было дальше. После произошедшего Алиса погрузилась в состояние шока и не произносила ни слова. Я тактично не стал утомлять её расспросами. Помывшись в каком-то ручье, мы дошли до отеля. Перед самым входом она спросила:\n-Что это было блять?\nНе зная, что ответить, я начал петь:\n-Words like violence, break the silence.\nОна посмотрела на меня как на ебанутого и ушла. На следующий день её увезли в больницу с попыткой суицида. Я погрустил немного, и забыл об этом случае.\nПрошло тринадцать лет. Тот случай иногда всплывал в голове, но в целом, это было не более, чем воспоминание. Но проблема в том, что тот случай подарил нам нечто большее, чем воспоминания. И сегодня этот подарок празднует свой тринадцатый день рождения. Так вот... Дорогие читатели, подскажите, как убедить судью, что отца ребёнка нельзя облагать алиментами, если при зачатии ты ебал его мать, будучи абсолютно уверен, что она мертва','',NULL,'2025-04-08 06:33:48',0,1,2),(256,'Весь следующий день я был сам не свой. Ребята прекрасно видели моё состояние и всячески издевались, отчего выражение моей и без того кислой физиономии становилось ещё кислее.  Оставшуюся часть дня я думал о том, что сказать Алисе и как не опозориться при этом? Погруженный в свои мысли, я не заметил, как прошёл день. Прошёл полдник, и мы пошли на концерт. \nМы рассаживаемся на трибунах, ожидая начала концерта. Моё дневное оцепенение сменяется паникой. К счастью, Алисы нигде не видно, быть может мне не придётся позориться перед ней. На сцене что-то происходит, но я не обращаю внимания на всякие сценки или танцы, погрузившись в свои тяжкие думы. Внезапно какое-то движение на сцене привлекает моё внимание.\n\nЯ не верю своим глазам. На сцене появляется Алиса. Слегка неуверенной походкой она подходит к микрофону, берясь за него своими длинными худыми, немного дрожащими руками. Все окружение перестало иметь для меня значение, когда Алиса начала петь. \nDepeche Mode - enjoy the silence. Наслаждайся тишиной. Я завороженно смотрел и слушал. Эта песня гласит о том, что слова неважны и приносят только боль. Ну или что-то в этом роде. Мне неважно было, что поёт Алиса, мне просто хотелось смотреть не неё и слушать её голос. Её голос слегка дрожал и было очевидно, что она нервничает, оказавшись в центре внимания, но несмотря на это, Алиса продолжала петь, практически не сбиваясь с мелодии. В мою голову пришла мысль: \"Она выступает перед целым лагерем, на неё смотрят двести с лишним человек, а ты боишься просто позвать её на танцы?\" Я решил, что обязательно подойду к ней, чтобы при этом ни случилось. Я провожал её глазами, когда она закончила и стал ждать окончания концерта с последующей дискотекой. \n\nКонцерт окончился, и я вместе с остальным людским потоком отправился на танцпол, намереваясь перехватить Алису там. И тут я заметил её, отдаляющуюся от людского потока в сторону кустов. Настолько уверенно, насколько это возможно, я иду за ней и беру за руку. Она вздрагивает и разворачивается ко мне. \n-Привет, ты куда? Щас же дискач будет. Может быть... \n-Привет. Спасибо, конечно, но я не могу сейчас туда пойти, отпусти пожалуйста мою руку - судя по тону, она куда-то торопилась.\n-Но почему? -  я ещё крепче сжимаю кисть Алисы, мне не хочется её отпускать.\n-Прости, ты очень милый, но я не могу сейчас пойти с тобой - по окончании фразы она вырвала свою руку из моей хватки и направилась в сторону деревьев.\n-Алиса?!! Подожди!!!\n-Прости! - доносится до моих ушей удаляющийся голос девушки.\nЯ смущен. Что это было? Куда она пошла?  Если я милый, то почему она убежала от меня? За считанные секунды в моей голове сформировались тысячи вопросов, и единственный человек, который знал на них ответ, только что убежал в кусты, когда весь лагерь собрался на танцполе. И внезапно меня осенило: Алиса не может пойти со мной на дискотеку, потому что у неё уже есть кто-то, с кем можно пойти в кусты. Мои пальцы непроизвольно сжимаются в кулаки. Ревность и гнев затмевают мой разум. Кто этот таинственный ухажер? Я узнаю, кто он и набью ему морду. Ну или хотя бы попытаюсь. Усилием воли, я заставил себя успокоиться. Я решил, что должен знать своего врага в лицо. Я лично прослежу за их встречей, узнаю, кто он, и уже потом разберусь с человеком, который похитил мою любовь. Спустя минуту я, как верный рыцарь, направился вслед за своей королевой.\nМною движет мрачная решимость, я сказал себе, что я выдержу любое испытание, уготованное судьбой. Я заметил Алису, которая остановилась на поляне, и затаился в кустах. Конечно, я слегка переборщил со словами, ибо был готов увидеть что угодно, кроме этого... \n\nМоя королева откладывала личинку. Широко расставив длинные ноги, она сидела на корточках, со спущенными до щиколоток штанами. Благородное лицо обезображивает гримаса боли и напряжения. До моего слуха доносятся гулкие стоны и звуки падающего на землю говна. Я понимал, что рыцарь или какой-нибудь джентльмен не стал бы глазеть на даму в момент слабости, но по какой-то неведомой мне причине я остался на том же месте. В моей голове что-то переклинило, и я начал наблюдать за процессом с любознательностью натуралиста. Тем временем Алиса оставила уже довольно большую кучу, но по интенсивности процесса было ясно, что до конца ещё далеко. Внезапно я почувствовал напряжение в штанах. Осознаю, что у меня встал член. Борьба с совестью не заняла много времени. \"А что? Можно было бы и сказать, куда ты идёшь, вместо того, чтобы мучать меня неизвестностью\" - приговаривал я себе, вытаскивая член из штанов и начиная дрочить. Всё это очень странно. Мне стало немного не по себе, когда она пыталась исторгнуть из своего кишечника особо крупный кусок.\n\nПохоже, что это причиняет ей сильную боль, ибо на её все ещё прекрасном, несмотря на обстоятельства, лице появились ручейки слез. Боги решили, что обрушили на её долю слишком мало испытаний, и вдруг из её промежности внезапно начинает стекать небольшая струйка крови. Она смотрит вниз, и начает рыдать, не прекращая при этом основного процесса, сопровождаемого, кстати, звуками обильного пердежа. Вдруг я ощущаю себя благородным рыцарем. В то время как у любого зрелище срущей девушки вызвало бы отвращение, я с удовольствием дрочу на это. \"Какой же я все-таки джентльмен\" - пронеслось в моей голове. Не прекращая дрочить, я с вожделением наблюдал, как Алиса исторгает последнюю порцию. Срет она действительно по-королевски. Я уже собирался кончать, как вдруг замечаю, что она смотрит прямо на меня. Её зелёные глаза округлились, в них можно было прочесть удивление и страх. \n\nЯ понимал, что поставил свою даму сердца в неловкое положение, оставаясь в укрытии. Поэтому я тут же выпрямился во весь рост, приветливо махая левой рукой, поскольку в правой держал эрегированный член. \"Как же она все-таки прекрасна\" - подумал я, когда её лицо исказилось в гримасе ужаса, и она закричала. Я пытаюсь сделать шаг навстречу любви всей своей жизни и понимаю, что спущенные штаны с трусами мешают мне это сделать. Решения принимать надо было быстро, поэтому я молниеносно стянул с себя всю одежду и побежал в сторону Алисы. Та, в свою очередь, по какой-то причине неверно поняла мои благородные намерения и тут же вскочила с места. Я был уже на полпути, когда она попыталась натянуть штаны и побежала в сторону леса. И вот, когда между нами осталось не больше метра, я чувствую, что моё равновесие нарушилось, и я падаю вперёд. Увлекшись погоней, я совершенно забыл о насранной куче, на которой я только что поскользнулся. В последнем рывке я успеваю схватиться руками за бедра Алисы. Так получилось, что она не успела полностью натянуть штаны и при падении я врезаюсь лицом в её голую  задницу. Некоторым сюрпризом для меня стал тот факт, что последняя порция говна таковой не являлась, и щедрый кишечник моей избранницы наградил меня новой. Ощущая во рту водянистую субстанцию и вдыхая характерный аромат, я почувствовал, что мой член напрягся ещё сильнее и теперь упирался в ногу Алисы. Она тоже это почувствовала, и попыталась вырваться из моих объятий. Я лишь крепче сжал её бедра и поднял голову, сплевывая кусочки говна. Я упёрся ладонью в поясницу Алисы, пытаясь подвинуть свое тело поближе к ней. Уже достигший пика эрекции член упёрся в её обосранную жопу, когда я аккуратно схватил её за плечи, пытаясь успокоить.\n-Алиса, ты чего? Не бойся, я никому ничего не расскажу. Никто не узнает, что здесь было... - моё дыхание сбилось от погони и возбуждения, поэтому слова выходили отрывисто - не бойся, милая, я не причиню тебе вреда... - при этих словах мой член дернулся, и Алиса закричала. \n-ПОМОГИТЕ, АААААААА, УМОЛЯЮ, ПОМОГИТЕ, ПОЖАЛУЙСТА!!!!!! - она извивалась подо мной, как уж на сковородке - СПАСИТЕ, ПРОШУ!!! \nТак не пойдёт, её крик слышно на всю округу, и если так пойдёт дальше, то скоро весь лагерь узнает об этом случае. Такого нельзя допускать. Я резко переворачиваю Алису на спину, прижав ладонь к её рту. Мы снова встречаемся взглядами. Я смотрю на неё с лаской, в то время как её заплаканные глаза полны ужаса. \n-Послушай, мы неправильно друг друга поняли, давай спокойно все обсудим? Сейчас я отпущу руку и... - я не успел договорить, как почувствовал резкую боль в яйцах. \n\nЯ тут же сложился пополам, хватаясь руками за ушибленное место. Тем временем, Алиса уже встала на ноги и собиралась бежать, но в последний момент споткнулась о мою вытянутую ногу и упала лицом в землю. Очнувшись от боли, я поднял голову. Алиса лежала на земле, не двигаясь. С характерным звуком, её кишечник полностью опорожнил себя, исторгнув наружу полупереваренные остатки пищи. К уже ставшему привычным запаху фекалий добавился резковатый запах мочи. Похоже, Алиса потеряла сознание. Я подхожу к ней и переворачиваю на спину. Судьба сыграла с ней злую шутку и при падении она упала лицом в ту же кучу, что насрала накануне. Не обращая внимания на такие мелочи, я приложил два пальца к её шее, и тут же отшатнулся. Пульс отсутствует. Моя возлюбленная не проявляла признаков жизни.','',NULL,'2025-04-08 06:34:35',0,1,2),(257,'Эта трагическая история произошла, когда мне было пятнадцать. Родители отправили меня в летний лагерь. Признаюсь честно: я был замкнутым необщительным подростком, и перспектива провести почти месяц в окружении сверстников наполняла меня ужасом.  Но ребята из нашего отряда оказались дружелюбными и понимающими, и спустя некоторое время я осознал, что мы не так уж и сильно отличаемся. Дни были похожи друг на друга, но этот, несмотря на схожесть с остальными, был особенным. Именно этот день был очень важным моментом в моей жизни, ведь именно тогда, на прокуренном балконе, в окружении товарищей я начал вникать в науку обращения с противоположным полом… \n\n-Прикиньте, пацаны, я с Олесей замутил, пиздец у неё сиськи здоровые. На ощупь тоже ниче такие - это Саша хвастается своими успехами на личном фронте.  \n-Заебися пахнет пися, а я думаю подкатить к Лине, только в душе не ебу, че делать, чтобы… ну, не оттолкнуть типа - стряхивая пепел, говорит Лёха \n-В смысле как? Берёшь и подкатываешь, хули ещё тебе надо? - сказал Никита \n-Нихуя, а это мысль - лицо Лехи приняло интеллегеньное выражение. \n-Ну а ты, брат? Когда уже начнёшь ебать  тёлок? - спрашивает меня Никита. Моё приподнятое настроение сразу же опускается.\n-Я не хочу никого ебать, чувак, забей - пытаюсь сделать вид, что меня это не интересует. \n-Да ну, даже Алису? - ухмыляясь, спрашивает Ваня.\n-Эта та рыжая которая, длинная с четырнадцатого? - уточняет Саша.\nСаша не ошибся. Алиса из четырнадцатого отряда. Высокая, стройная, рыжеволосая и зеленоглазая Алиса не могла не овладеть моим сердцем. \n-А что Алиса? Ну да, она симпатичная, не более... - как бы я ни хотел, мне не удалось скрыть смущения. \n-Именно поэтому ты пялишься на неё, как будто у неё пизда поперёк? - уточнил Леха. \n-Или сиськи ищешь? Не найдёшь, братан, она же доска, епт - вставил Ваня. \n-Если она тебе нравится, подкати к ней, хули ты тупишь то блять? - у Саши всегда все просто. \n-Всё не так просто... \n-Ну так давай упростим тебе задачу - Никита встал с кресла - сейчас я приведу её сюда, и ты прямо здесь скажешь ей, какая она секси и что ты хочешь её трахнуть. Ну или мы скажем, похуй вообще. \n-ЧТО?!!! - От подобного заявления на моей коже поползли мурашки - Не делай этого!!! \n-Ну, чел, ты можешь и сам это сделать, мы лишь пытаемся помочь. \n-Ты блять понимаешь, в какое идиотское положение поставишь меня? Ещё друзья, называется. \n-Да, хули нет? Мы хотим тебе только добра, братан - говорит Ваня - если Магомет не идёт к горе, то гора идёт нахуй. \n-Да идите нахуй сами, пидоры! \nПосле небольшой паузы Никита решил уточнить:\n-Ну, так че, ебать, ты катишь шары сам или нам помочь? \nЯ самыми красочными словами дал понять, что в их помощи я не нуждаюсь. И что, раз уж они не оставили мне выбора, то я позову Алису потанцевать на завтрашней дискотеке. Надо же с чего-то начинать, правда? Это вполне устроило парней, и мы ушли спать.','',NULL,'2025-04-08 06:34:51',0,1,2),(258,'','/uploads/image-1744083384685-0.jpeg',NULL,'2025-04-08 06:36:23',0,1,4),(259,'Всем новеньким добро пожаловать в нгушный филиал двача','',NULL,'2025-04-08 06:48:36',0,5,2),(260,'Привет, это тот анон, высравший вчера длиннотекст про дарк фентези и не желание прекращать существовать, следующий текст это снова не копипаста из интернета. \n\nОткрыл вчера для себя скачивание FLAC вместо прослушивания в спотифае.\n\nЯ люблю слушать музыку, особенно, если в течение трека есть разнообразие какое-то, есть разнообразный инструментал и вокалист умеет и так и этак (больше всего мне нравится, когда у него голос высокий), а не как, например, в обычном, даже можно сказать, нормисном павер-метале несколько минут одинаково долбят инструменты и филиал безыдейности на вокалисте не меняет свой тон/хз что ещё ну вы поняли.\n\nВообще, за последние несколько лет всегда хотел купить электрогитару и начать учиться извлекать звук из этого прекрасного инструмента, но я безработный балбес пока что и денег у меня на такое нет, а покупать рандом срань дешёвую для первого раза я не хочу, я уверен, что я буду этим заниматься. Но при этом вы видели вообще цены на них (кстати, думаю, вообще на все инструменты) после сво? Fender Squier Bullet HHS Arctic White такой средненький вполне, подходящий для серьёзно начала с 16к вырос в цене до 35к. Это ж поебистика полнейшая, как так можно, Слава Богу Z🙏❤️ СЛАВА Z🙏❤️АНГЕЛА ХРАНИТЕЛЯ Z КАЖДОМУ ИЗ ВАС🙏❤️БОЖЕ ХРАНИ Z🙏❤️ СПАСИБО ВАМ НАШИ СВО🙏❤️🇷🇺ХРАНИ ZOV✊🇷🇺💯СПАСИСлава Богу Z🙏❤️СЛАВА Z🙏❤️АНГЕЛА ХРАНИТЕЛЯ Z КАЖДОМУ!\n\nТак вот. Сидя в своих беспроводных, но тем не менее полноразмерных и имеющих поддержку LDAC наушниках, и слушая треки с имеющимися в них частями без электрогитары, я заметил приятную разницу со спотифаем, где было выставлено максимальное для него качество звука. Слышно было больше мелких деталей и звук в целом чище (в частности, на барабабанных партия стало гораздо лучше слышно инструмент, прям отдельные удары чётко и чисто выслушивать можно было). Сидел я так до трёх ночи, откинувшись на стуле назад, раскачиваясь и держась обоими руками за затылок, пока не пришёл сосед и я с мыслями \"бляяя опять не поспал хорошо\" решил лечь спать.\n\nКстати, не знаю стриминговых сервисов удобных, где была бы поддержка Hi-Fi. Видел у лестнице в старом корпусе рекламу какого-то сервиса сбера с поддержкой этого, но это всё ещё российская площадка с отвалом кучи всего англоязычного, я уверен, что так и есть (в яндекс музыке точно так). Поэтому продолжу пока что пользоваться спотифаем и скачивать самый сок в FLAC с рутрекера. \n\nХотел бы просто сказать этим всем, что те, кто слушают не ебучие биты и прочую нормизную поебень и при этом именно слушают музыку, а не ставят её ради фона, (слово \"должны\" тут не хочу сказать, не то, не подходит) should хоть раз попробовать послушать в полноразмерных наушниках в качестве без потерь.\n\nКстати, вот ещё. Никогда не мог слушать что-то фоном,например, во время учёбы, написания дз и так далее. Либо я сосредоточен на том, чем занят, либо я слушаю музыку, два отдельных занятия. Даже в играх я иногда полностью убавлял громкость саундтреков.','','Длиннотекст','2025-04-08 07:28:35',0,3,2),(261,'К предыдущему посту.\n\nЯ слушал именно оркестровые партии, в гитарные я даже выслушивать я не пытался, чтоб разницу заметить, вот это уже точно для пердонюхов и нетакусиков звукодрочеров с качеством только на бумаге.','',NULL,'2025-04-08 09:39:36',0,1,2),(262,'сколько можно картинок запостить??\nкстати, если вырал картинку, то её уже не удалить','/uploads/image-1744095437610-0.jpeg,/uploads/image-1744095437611-1.jpeg,/uploads/image-1744095437618-2.jpeg,/uploads/image-1744095437614-3.jpeg,/uploads/image-1744095437623-4.jpeg,/uploads/image-1744095437622-5.jpeg,/uploads/image-1744095437617-6.webp,/uploads/image-1744095437628-7.jpeg,/uploads/image-1744095437620-8.jpeg,/uploads/image-1744095437631-9.jpeg,/uploads/image-1744095437611-10.jpeg,/uploads/image-1744095437633-11.jpeg',NULL,'2025-04-08 09:57:22',0,3,4),(263,'Ищу актива для встреч \nя няшка с фита 20 лет, 19 см ухоженный, без места','','ищу партнера доя занятий фронтендом','2025-04-08 10:29:51',0,3,2),(264,'видела тебя в библиотеке но побоялась подойти…\nоченб хочу познакомиься пожалуйста я не могу юез ткбя дить ответь в коммах или я начну спамить постами с гойдой ой хихихих👉👈','/uploads/image-1744098521188-0.jpeg','признавашки,очир','2025-04-08 10:48:41',0,4,2),(265,'Биопроблемники, вы че тут устроили блять? Какой ещё