о буйным. Однако, так же как и бабка, под любым предлогом искал социальных контактов, но не ради трепки, а ради алко. Впоследствии, он тоже стал приходить часто и стучать ко мне, в надежде обрести собутыльника на оставшийся вечер. Еще одна соседка была 40-летняя милфа с адским недоебом, который был виден по ее косметическому ебалу и откровенным юбкам, колготкам и кофточкам. Последний сосед - сука, еще одна бабка, которая лишь недавно приехала хуй пойми откуда, и ей нужно срочно обо всем кому-то рассказать. Но идти к другой бабке-соседке не варик - они в контрах, и она стала ходить ко мне. В итоге, утром ко мне стучалась поехавшая бабка, не открывал - оставляла пакет с мусором, днем меня не было, к вечеру, у лифта меня ждала вторая бабушка, которая парили байку о сросшихся костях и святой молитве какому-то Антуана. После 9-10 вечера, в дверь ломился упитый моряк, умолявший помочь ему осилить бутылку. И так было практически каждый день. Я так заебался, что попробовал каждому объяснить, чтобы оставили меня в покое - не помогло. Между тем моя дверь уже засыпалась мукой, порошками, мелками от тараканов и прочей всякой поеботой. Я, ахуевший от всего, попидорил к другану-медику. Он выписал мне рецептик какого-то убер слабительного. Придя домой, я целенаправленно наебенился кефира с солеными грибами и огурцами. Подождал глубокой ночи. Въебал слабительного и пошел срать под двери. Насрал всем, дабы не вызвать подозрений, надрыстал и себе. 6 утра. На площадке дикий ор и выяснения. Открываю. Бабка из кв напротив блажит как пгм-нутая. Вторая бабка веник, измазав в говне, мажет им стены возле двери первой бабки. Алкаш вообще не вышел. Милфа держится двумя руками за щеки и охает. Бабки выясняют отношения. Через пару дней, я свалил обратно в общагу','/uploads/image-1744347894665-0.jpeg','общага,жизнь','2025-04-11 08:04:56',0,3,2),(634,'','/uploads/image-1744348203242-0.jpeg',NULL,'2025-04-11 08:10:04',0,7,2),(635,'https://www.google.com/search?sca_esv=ea28a01ba0d65b63&sxsrf=AHTn8z