ал кроме моей любимой группы.\n\nНашёл плейлисты в спотифае, поспрашивал у гпт и сел слушать альбомы, которые он рекомендовал, \"похожие\" на то что я ему перечислил из того что я слушаю. \n\nПриступил к прослушиванию.\n\nСначала я думал, что это какие-то неудачные выборки и на самом деле есть что-то такое же прекрасное как 3 поздних альбома Blind Guardian и ещё немного Rhapsody of Fire. НО. Нет. В большинстве случаев это была просто павер-металлическая и тп долбёжка электрогитары и барабанов с даже скримингом и гроулингом БЛЯТЬ и где-то там на фоне партия каких-то оркестровых инструментов. Также там были треки с женским вокалом и местами даже приятными частями, где гитаре не уделялось самое большое внимание, но всё-таки было довольно однообразно и всё ещё слишком тяжело для того что я хотел найти и того что мне нравилось.\n\nВ итоге мне только гпт смог порекомендовать ебейший альбом \"Zero Gravity\" от Turilli/Lione Rhapsody, который я прослушал впервые ещё в 2020, через год после его выхода, который мега ахуенен и вообще альбом концептуальный, а это всегла база, кроме того там было абсолютно новое звучание и для автора и для жанра в целом.\n\nА ещё в где-то 1/3 случаев на обложках альбомов была женщина и я думаю теперь, что это признак безыдейности и безвкусицы.\n\nПост написал, пора встать с трона и жопу подтереть, в следующий раз что-нибудь про игры, наверное, напишу.','','Длиннотекст','2025-04-11 20:17:49',0,5,2),(647,'А вот теперь нашёл что-то стоящее, наконец-то.','',NULL,'2025-04-11 20:53:28',0,0,2),(648,'Ноунеймы попросили сфоткатся','/uploads/image-1744415696417-0.jpeg',NULL,'2025-04-12 02:54:59',0,14,31),(649,'друзья, поехали в центр…','','aanesthezia','2025-04-12 14:40:18',0,2,67),(650,'Там Исакий честное слово','/uploads/image-1744458659230-0.jpeg',NULL,'2025-04-12 14:51:10',0,3,43),(651,'«Суки из Новосиба в Барнаул заказали»','/uploads/image-1744458917269-0.jpeg',NULL,'2025-04-12 14:55:18',0,3,43),(652,'ребятки чем занимаетесь все?','','кристинанастя',