Опыт на 10/10 всем советую','',NULL,'2025-04-20 17:26:59',0,6,43),(731,'Теперь неделю куличи кушать(','',NULL,'2025-04-21 08:00:27',0,3,2),(734,'','/uploads/image-1745247205337-0.png',NULL,'2025-04-21 17:53:32',0,4,4),(735,'','/uploads/image-1745320440351-0.jpeg',NULL,'2025-04-22 14:14:02',0,3,14),(736,'Федор Пивоваров, с днем рождения!!!🇷🇺🇷🇺🇷🇺✊👍🫡🤙🤙🍾','',NULL,'2025-04-22 14:14:41',0,2,31),(737,'с днём рождения фёдрп пивоваров','',NULL,'2025-04-22 14:20:48',0,1,4),(738,'','/uploads/image-1745321227884-0.jpeg',NULL,'2025-04-22 14:27:08',0,0,4),(739,'братва как ваш день прошел','',NULL,'2025-04-22 18:48:03',0,5,8),(740,'блять, короче приснилось, как команда каких то блоггеров на дороге рекламировали бутафорскую кровь, причё её было нстолько много, что даже я во сне сказал ебать чё за хуйня, но в целом оно так и было, на этот пиздец приехало ещё больше копов, то есть ахуеть, чуваки с одной стороны стоят и с бочками и кубометрами крови стоят на дороге и с LEOMAX\'овым ебалом рассказывают какая у них пиздатая настоящая кровь, а сдругойстороны копы уже готовы спускать курок на этих пидорасов... Жалко не дошло до этого, а сон просто оборвался\n\n\nhttps://youtu.be/dOapjBTqLLs?si=p_1gvhcmoX_uGReD','',NULL,'2025-04-23 06:47:10',0,4,2),(741,'утомились','/uploads/image-1745390605276-0.jpeg','кристинанастя','2025-04-23 09:43:25',0,6,8),(742,'если не хотите промокнуть под дождем, используйте кепик (лизу)','/uploads/image-1745406879222-0.jpeg','лизакениг','2025-04-23 14:14:50',0,5,26),(743,'','/uploads/image-1745509243094-0.jpeg',NULL,'2025-04-24 18:40:49',0,5,43),(744,'– Даш, да брось. Ну бывает иногда…\n\nДевушка в ответ захлопнула входную дверь. В квартире воцарилась тишина. Андрей выдохнул и пошел к холодильнику за пивом, наполнил стакан и уселся за стол. Пару минут он так просидел не двигаясь, а потом хлопнул кулаком по столу. И зачем он только это сказал?\n\n– Слов нет. Пи-пец.\n\nВ квартире царил бардак, выброшенные из шкафов вещи валялись на полу одной кучей. Андрей начал разбирать одежду и складывать её обратно на место. С уходом Даши на полках образовалось много свободного места. В квартире было тихо и холодно.\n\n– Все перепуталось ещё. Половину шмоток теперь на стирку.\n\nБыть может это и к лучшему. Но почему же так тоскливо внутри?\n\nАндрей махнул рукой и налил себе ещё пива, включил комп и запустил сериал. Он пересматривал одну и ту же серию несколько раз, поскольку сюжет от него ускользал. В голове роились мысли. Почему? Чем он виноват? Его вины здесь нет. Просто так получилось. С каждой минутой он все больше и больше накручивал себя, распалившись до такой степени, что понял, что кто-то появился в квартире только по шагам в коридоре.\n\n– Чё, вернулась? Аа, это ты… – злость Андрея испарилась, когда он увидел Лизу. – Убежала твоя сестра.\n\n– Я знаю, к тебе пришла… Помочь. – девушка присела на краешек кровати и смущенно поправляла волосы.\n\n– Да чё тут помогать. – он заправил футболку в шорты, надеясь, что Лиза не заметила пятно от пива. – Сам справлюсь.\n\nДевушка молча сняла куртку, опустилась на колени и начала перебирать вещи. Андрей заметил в выглядывающие из-под свитера пару трусов и, краснея, схватил в охапку всю кучу.\n\n– Это все стирать надо. Если хочешь помочь, то… Не знаю, вон можешь поискать, что Даша забыла.\n\n– Пусть сама ищет, если ей надо. – Лиза поправила юбку и стрельнула на него взглядом на него из-под опущенных ресниц. – А у тебя еда есть? Я такая голодная…\n\n– Нет. – Андрей мрачно покосился на неё. – Если только приготовить что-то.\n\nДевушка покопалась в полках, достала из морозилки кусок мяса, нарезала и натерла овощи. Повозилась с духовкой, вымыла грязную посуду и протерла плиту. Андрей пытался сопротивляться, но Лиза решительно выгнала его и шутя запретила заходить на кухню. Парень послонялся без дела, заскучал и от нечего делать решил все-таки прибраться в доме. Он выбросил мусор, пропылесосил, поправил подушки и вытер пыль. Наткнулся на фотографию с прошлогоднего отпуска с Дашей. Он некоторое время смотрел на улыбающиеся лица, а потом вытащил фото из рамки и убрал в дальний ящик.\n\nК тому моменту, как ужин был готов в зале ничего не напоминало о недавних событиях. Он и сам практически обо всем забыл.\n\nЛиза наконец позвала его на кухню. На столе стояла бутылка красного вина и тонко нарезанный сыр. Аромат запеченного мяса дразнил нос, огурцы, помидоры и сладкий красный перец теснились на блюде и ждали едоков. Спагетти с густым соусом уже были разложены по тарелкам.\n\n– А… откуда все это?\n\n– Да я к друзьям шла… – Лиза смущенно наклонила голову. – Решила лучше к тебе зайду. Садись, приятного аппетита.\n\nАндрей откупорил бутылку, достал запыленные бокалы, протер их и разлил вино. Поначалу ели молча, пытаясь скрыть неловкость. Потом он вспомнил, как помогал Лизе готовиться к выпускным экзаменам. Она засмеялась, припомнив шпаргалки, которые обнаружила строгая учительница по физике, Нина Павловна, у неё под чулками, как потом ходила пересдавать другому преподавателю. Потом пошли в ход анекдоты, чем дальше, тем более неприличные. Под конец и вовсе зазвучали скабрезные шутки.\n\nДевушка раскраснелась, откинулась на спинку стула и обмахивалась полотенцем, Андрей почувствовал, как вино вернуло приятное тепло внутри. Он украдкой посмотрел на неё и наткнулся на испытующий взгляд. Лиза оценивающе смотрела ему прямо в глаза, полные губы обольстительно изогнулись, выглядывающая из глубокого декольте грудь вздымалась от дыхания.\n\n– А знаешь, ты всегда мне нравился. – с таким макияжем Лиза выглядела гораздо старше, как будто одного с ним возраста. – И когда мне Даша позвонила, я подумала… Я подумала, может быть теперь…\n\nАндрей покраснел и чуть отодвинулся.\n\n– Слушай, это… неправильно. Лучше тебе уехать домой.\n\n– Пожалуйста…Ты считаешь меня маленькой, но мне уже девятнадцать лет!\n\n– Э-э-э. Даша же твоя сестра.\n\n– Она сама виновата, если не может разглядеть от чего отказывается! – Лиза накручивала локон на палец и не смотрела на Андрея.\n\n– Она тебе ничего не сказала?\n\n– Нет, сказала, что между вами все кончено и бросила трубку.\n\nАндрей покачал головой и погладил Лизу по голове.\n\n– Лучше не стоит.\n\n– Можно хотя бы я останусь у тебя переночевать? – Лиза умоляюще посмотрела на него снизу-вверх. – Может ты купишь ещё вина?\n\nОн задумался на несколько секунд и сдался.\n\n– Ну хорошо.\n\nАндрей оделся и пошел в магазин. Голова шла кругом от происходящего, ещё не успел отойти от прежнего расставания и тут тебе такое испытание. Мало кто устоит перед чарами этой красотки. А он сам? Что он чувствует в отношении неё после того, что случилось? Нужно было хорошенько все обдумать. И желательно на холодную голову.\n\nАндрей зашел в магазин и помимо вина купил ещё и коньяк. После этого долго сидел на скамейке в ближайшем сквере, не решаясь вернуться домой. Он принял решение, когда на город опустилась ночь. В квартире было тихо и темно, только из спальни доносился слабый свет.\n\nОн на цыпочках подошел к двери и увидел зажженные ароматические свечи, девушка лежала на кровати, на ней были только черные чулки.\n\nЗаснула, не дождавшись его. Он тихо подошел к ней и на некоторое время застыл, всматриваясь в юное прекрасное лицо, потом принес плед и укрыл её. Девушка что-то сказала во сне и повернулась на другой бок.\n\nОн вздохнул и тихо сказал:\n\n– Все равно бы у нас ничего не вышло. Ты ещё не знаешь мой секрет. Я изнасиловал твоего батю.','/uploads/image-1745568377627-0.jpeg',NULL,'2025-04-25 11:06:15',0,8,2),(745,'я пью фиалковый лимонад оч вкусно','',NULL,'2025-04-26 12:10:49',0,4,8),(746,'','/uploads/image-1745734623962-0.jpeg',NULL,'2025-04-27 09:17:05',0,2,2),(747,'','/uploads/image-1745736729879-0.jpeg','adm','2025-04-27 09:52:11',0,5,2),(748,'я покрасилась друзья💋','/uploads/image-1745745158184-0.jpeg','aanesthezia','2025-04-27 12:12:42',0,8,67),(749,'лёвик','/uploads/image-1745748966324-0.jpeg',NULL,'2025-04-27 13:16:07',0,3,8),(750,'На выходных видел, как проститутка идет к сборищу дагестанцев, а потом оттуда пачка ментовских машин выезжает. Один мент даже с пистолетом кудато бежал. Короче, хорошие выходные, классно покатались на следующий день с друзьями в центре Новосиба. Сегодня меня затащили на КУБИК КВН ФМШ….ребята, мы теряем комедию. Но ребята молодцы, хоть както. Если ктото еще там был, пишите в комментах че как вам','/uploads/image-1745762210400-0.jpeg','матье бал','2025-04-27 16:56:56',0,7,1),(751,'Не, ну сегодня реально ужаасный сон. Сижу я в общаге с кентами, чё то пиздим, тут кто-то предлагает танки скачать, поиграть, ну а я чё, думаю заебись, ща я с этими лохопедами, которые еле как на газ жмут, поиграю, тут, вдруг, мне пишет ещё один друг, и как назло у них там целая кега пива, вы понимаете какая ужасная дилемма? Ехать два часа к другу за пивом, или поиграть в танки. Вы бы чё сделали?','/uploads/image-1745804818593-0.jpeg',NULL,'2025-04-28 04:46:59',0,3,2),(752,'с братом 👊🏻👊🏻✊🏻👊🏻👊🏻✊🏻👎🏻💪💪💪💪💪💪','/uploads/image-1745830746511-0.jpeg','#очирмойбрат','2025-04-28 11:59:10',0,8,55),(753,'А у меня СВАГАнааад','',NULL,'2025-04-28 19:21:05',0,3,1);
